import React from "react";

import FormInput from "src/components/form-input/FormInput";

import "src/components/signup/signup.styles.scss";

class SignUp extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: "",
      confirmPassword: "",
      displayName: "",
    };
  }

  handleSignUpFormChanged = () => {};

  render() {
    const { email, displayName, password, confirmPassword } = this.state;

    return (
      <div className="sign-up">
        <FormInput
          type="text"
          name="displayName"
          label="Display Name"
          value={displayName}
          onHandleChange={this.handleSignUpFormChanged}
        />
        <FormInput
          type="email"
          name="email"
          label="Email"
          value={email}
          onHandleChange={this.handleSignUpFormChanged}
        />
        <FormInput
          type="password"
          name="password"
          label="Password"
          value={password}
          onHandleChange={this.handleSignUpFormChanged}
        />
        <FormInput
          type="password"
          name="confirmPassword"
          label="Confirm Password"
          value={confirmPassword}
          onHandleChange={this.handleSignUpFormChanged}
        />
      </div>
    );
  }
}

export default SignUp;
